function Users() {
  const [data, setData] = useState([]);
  useEffect(() => {
    axios
      .get("https://stekpayout.onrender.com/merchants")
      .then((res) => {
        console.log();
        setData(res?.data?.data);
      })
      .catch((err) => {
        alert("Something went wrong. ");
      });
  }, []);

}
export default function Marchant() {
  return (
    <div>
      <div>
TABLE OF USERS :
<table>
<tr>
<th> ID </th>
<th> EMAIL </th>
<th> FIRST NAME</th>
<th> LAST NAME</th>
</tr>
{
data.length > 0 &&
data.map((item) => {
return (
<span> {item.email}, </span>
) 
})
}
</table>
</div>
    </div>
  ); 
}
